        },
        {
            value: '7',
            label: 'Julio',
        },
        {
            value: '8',
            label: 'Agosto',
        },
        {
            value: '9',
            label: 'Septiembre',
        },
        {
            value: '10',
            label: 'octubre',
        },
        {
            value: '11',
            label: 'Noviembre',
        },
        {
            value: '12',
            label: 'Diciembre',
        },
      ]

      const [dia, setdia] = useState('Seleccionar día');
      const [mes, setMes] = useState('seleccionar mes');

    const handleChange = (event) => {
        setdia(event.target.value);
    }

    const handleSubmit = async(e) => {
        e.preventDefault();
        console.log("Día: " + dia);
    }

  return (
    <>
    <form onSubmit={handleSubmit}>
        <Box
        component="form"
        sx={{
            '& .MuiTextField-root': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
        >
            <div>
            <TextField
            id="filled-select-currency-native"
            select
            label="Native select"
            value={dia}
            onChange={handleChange}
            SelectProps={{
                native: true,
            }}
            helperText="Please select your currency"
            variant="filled"
            >
            {day.map((option) => (
                <option key={option.value} value={option.value}>
                {option.label}
                </option>
            ))}
            </TextField>
            </div>  
            <div>
            <TextField
            id="filled-select-currency-native"
            select
            label="Native select"
            value={mes}
            onChange={handleChange}
            SelectProps={{
                native: true,
            }}
            helperText="Please select your currency"
            variant="filled"
            >
            {month.map((option) => (
                <option key={option.value} value={option.value}>
                {option.label}
                </option>
            ))}
            </TextField>
            </div>  
        </Box>
        <Button type='submit' className='button' variant='contained'>enviar</Button>
    </form>
    </>
  )
}

export default RegistrarFecha
